import * as React from 'react';
import { Text,TextInput,View, Image,ImageBackground, StyleSheet } from 'react-native';
import { Icon,Button } from 'react-native-elements'

const imgbg = require('../assets/ex.jpg');

export default class LoginScreen extends React.Component {
  static navigationOptions ={
    header: null
  }

  render() {
    return (
        <ImageBackground source={imgbg} style={{width: '100%', height: '100%'}}>
          <View style={styles.container}>
            <View style={styles.containerUserName}>
              <Icon type="font-awesome" name="user" color="gray" containerStyle={styles.icon}/>
              <TextInput placeholder="Usuario" placeholderTextColor="gray"
              style={styles.textInput}/> 
            </View>

            <View style={styles.containerPassword}>
              <Icon type="entypo" name="key" color="gray" containerStyle={styles.icon}/>
              <TextInput placeholder="Contrasena" placeholderTextColor="gray"
              style={styles.textInput} secureTextEntry={true}/> 
            </View>

            <View style={styles.containerSignIn}>
              <Button title='Iniciar' backgroundColor='#ffa100'/>
            </View>
            
            <View style={styles.containerRegister}> 
              <Text style={{color:'white',fontWeight: 'bold'}}>Create and Account?
                <Text  onPress={() => this.props.navigation.navigate('Register')}
                style={{color:'red',fontWeight: 'bold'}}>  Register</Text>
              </Text>
            </View>
            
          </View>        
        </ImageBackground>
    );
  }
}

const styles = StyleSheet.create({
  container:{
    flex:1,
    flexDirection: 'column',
    justifyContent:'center',
    alignItems: 'stretch',
  },
  containerSignIn:{
    height: 60,
    marginLeft:'6%',
    marginRight:'6%',
    marginTop:'10px'
  },
  containerUserName:{
    height: 60,
    flexDirection:'row',
    justifyContent:'center',
    backgroundColor:'#ffffff',
    marginLeft:'10%',
    marginRight:'10%',
  },
  containerPassword:{
    height: 60,
    flexDirection:'row',
    justifyContent:'center',
    backgroundColor:'#ffffff',
    marginLeft:'10%',
    marginRight:'10%',
  },
  containerRegister:{
    height: 60,
    marginLeft:'6%',
    marginRight:'6%',
    alignItems: 'center',
  },
  icon:{
    flex:1
  },
  textInput:{
    backgroundColor:'transparent',
    flex:5,
    color:'black',
    paddingLeft:'25%'
  }
})
